import React from 'react';
   
import Menu from "../components/Menu";
import "../components/Contents.css";

const Member = () => {
    return (
        <>
            <Menu />
            <div className="wrap">
                <div className="groupinfo">
                    <div className="groupimg"></div>
                    <div className="memberbox">
                        멤버목록
                    </div>
                </div>
            </div>
        </>
    );
};

export default Member;
